import React, { useState } from 'react'
import PatientNavBar from '../Components/PatientNavBar'
import { useParams, useLocation } from 'react-router-dom';
import axios from 'axios';
import Styles from '../Styles/Patients.module.css'
function BookAppointment() {
  // let location =useLocation();
  const [symptoms, setSymptoms] = useState("")
  let { patId, id } = useParams();
  console.log(patId + id)
  async function bookApp() {
    alert("Appointment booked ")
  }
  return (
    <>
      <PatientNavBar />
      <div className={Styles.symptomContainer}>
        <div className={Styles.symptomContainerIn}>
          <table>
            <tr>
              <td><h3> Symptoms</h3></td>
              <td><input type='text' placeholder='Enter your symptoms' value={symptoms} onChange={(e) => setSymptoms(e.target.value)}></input></td>
            </tr>
            <tr>
              <td></td>
              <td></td>
            </tr>


          </table>
          <button onClick={bookApp} >Book Appointment</button>
        </div>
      </div>
    </>
  )
}

export default BookAppointment
